// Define TypeScript interfaces for props
interface CardProps {
  title: string;
  rating: string;
  imageUrl: string;
}

interface CardsContainerProps {
  cardsData: CardProps[];
}

// Card Component
const Card: React.FC<CardProps> = ({ title, rating, imageUrl }) => {
  return (
    <div className="bg-white rounded-lg shadow-lg overflow-hidden">
      <img src={imageUrl} alt={title} className="w-full h-32 sm:h-48 object-cover" />
      <div className="p-4">
        <h3 className="text-lg font-semibold">{title}</h3>
        <div className="flex items-center my-2">
          <span className="bg-yellow-400 text-white text-xs px-2 py-1 rounded-full mr-2">{rating}</span>
        </div>
      </div>
    </div>
  );
};

// Cards Container Component
const CardsContainer: React.FC<CardsContainerProps> = ({ cardsData }) => {
  return (
    <Swiper
      slidesPerView={3}
      spaceBetween={30}
      pagination={{
        clickable: true,
      }}
      className="mySwiper"
    >
      {cardsData.map((card, index) => (
        <SwiperSlide key={index}>
          <Card {...card} />
        </SwiperSlide>
      ))}
    </Swiper>
  );
};

